import React, { Component } from "react";

import '../App.css';
import { Card } from "react-bootstrap";

class NotBuilt extends Component{
    render()
    { 
        return (
            <section className="container">
          <form>
          <section className="row">
          <Card
    bg='light'
    key='info'
    text='dark'
    style={{ width: '70rem' }}
    className="mb-2">
    <Card.Body>
      <Card.Text>
   <h1> Page yet to be built</h1>
      </Card.Text>
    </Card.Body>
  </Card>
       </section>
          </form>
          </section>
        );  
    }
}

export default NotBuilt
